/** @format */

import React from 'react';
import { Line, Doughnut, Bar } from 'react-chartjs-2';

function AdminDashboard(props) {
	const data = {
		labels: ['1', '2', '3', '4', '5', '6'],
		datasets: [
			{
				label: '# of Votes',
				data: [12, 19, 3, 5, 2, 3],
				fill: false,
				backgroundColor: 'rgb(255, 99, 132)',
				borderColor: 'rgba(255, 99, 132, 0.2)'
			}
		]
  };

  const data2 = {
		labels: ['Red', 'Blue', 'Yellow', 'Green', 'Purple', 'Orange'],
		datasets: [
			{
				label: '# of Votes',
				data: [12, 19, 3, 5, 2, 3],
				backgroundColor: [
					'rgba(255, 99, 132, 0.2)',
					'rgba(54, 162, 235, 0.2)',
					'rgba(255, 206, 86, 0.2)',
					'rgba(75, 192, 192, 0.2)',
					'rgba(153, 102, 255, 0.2)',
					'rgba(255, 159, 64, 0.2)'
				],
				borderColor: [
					'rgba(255, 99, 132, 1)',
					'rgba(54, 162, 235, 1)',
					'rgba(255, 206, 86, 1)',
					'rgba(75, 192, 192, 1)',
					'rgba(153, 102, 255, 1)',
					'rgba(255, 159, 64, 1)'
				],
				borderWidth: 1
			}
		]
  };

	const options = {
		scales: {
			yAxes: [
				{
					ticks: {
						beginAtZero: true
					}
				}
			]
		}
	};

	return (
		<div className="container">
			<div className="row">
				<div className="col-md-3">
					<p className="text-box">Number of Registered Users</p>
				</div>
				<div className="col-md-3">
					<p className="text-box">Number of Registered Farms</p>
				</div>
				<div className="col-md-3">
					<p className="text-box">Number of Products in Database</p>
				</div>
				<div className="col-md-3">
					<p className="text-box">Number of Used Products</p>
				</div>

				<div className="col-md-6">
					<p className="col-box">Number of Registered Farm Today</p>
				</div>
				<div className="col-md-6">
					<p className="col-box">Number of Registered Farm Today</p>
				</div>
			</div>
			<div className="col-md-6">
				<div className="mt-3">
					<p className="">Used Products</p>
					<Line data={data} options={options} />
				</div>
			</div>
			<div className="col-md-6">
				<div className="mt-3">
					<p className="">Used Products</p>
					<Doughnut data={data} options={options} />
				</div>
			</div>
			<div className="col-md-12">
				<Bar data={data2} options={options} />
			</div>
		</div>
	);
}

export default AdminDashboard;
